function beforeCancelProcess(colleagueId,processId){
	var ABERTURA = 4;
	var APROVACAO_GESTOR = 5;
	var VALIDACAO = 48;
	var APROVACAO_RH = 27;
	var ALTERACAO_DATA = 67;
	
	
var ativAtual = getValue("WKNumState");
	
	log.info("Processo beforeCancel - atividade: " + ativAtual);
	
	if (ativAtual != ABERTURA && ativAtual != APROVACAO_GESTOR && ativAtual != VALIDACAO){
		
		 throw "Você não pode excluir essa solicitação pois ela já está em processo de pagamento.";
		
	}
	
	
}

function servicetask88(attempt, message) {
	   //RECUPERA NUMERO DA ATIVIDADE
    var ativAtual = getValue("WKNumState");        
    //RECUPERA CODIGO DA SOLICITAÇÃO
    var codSolicitacao = getValue("WKNumProces");
    //VERIFICA QUAL A PROXIMA ATIVIDADE
    var nextAtv = getValue("WKNextState");
    //RECUPERA NUMERO DO DOCUMENTO
    var idDocumento = getValue("WKCardId");
    var idFormulario = getValue("WKFormId")
    var empresa = getValue("WKCompany");

    //recupera data de vencimento e converte para formato data
   // var dtVencimento = convertStringToData(hAPI.getCardValue("dtPagamento"));
    var dtAtual = new Date();


    var constraint = new Array();                                 
    constraint.push(DatasetFactory.createConstraint("documentid", idDocumento, idDocumento, ConstraintType.MUST));

    var resultDataset = DatasetFactory.getDataset("ds_get_Pagamentos", null, constraint, null);


  	if (resultDataset !== null && resultDataset.rowsCount >0 ){
 		if (resultDataset.getValue(0,"DATA_PAGAMENTO") != ''){
 			//preenche data de pagamento
        	hAPI.setCardValue("dtBaixa",resultDataset.getValue(0,"DATA_PAGAMENTO"));  	
 		}
 		else {
 			 throw 'Pagamento atrasado!';
 		}     		     	
 	}
 	else {
 		 throw 'Pagamento não localizado!';
 	}

}

//recebe data do Fluig e convert para data normal
function convertStringToData(StringToData) {
    var data = StringToData.split('/');

    return new Date(data[1] + "/" + data[0] + "/" + data[2]);
}

function beforeStateEntry(sequenceId){
	
	var ABERTURA = 0;
	var APROVACAO_GESTOR = 5;
	var VALIDACAO = 48;
	var APROVACAO_RH = 27;
	var ALTERACAO_DATA = 67;

	
	//RECUPERAR O ID DO PROCESSO
	var PROCESSO_ID = 3;
	
	//recupera atividade
	var ativAtual 		= getValue("WKNumState");	
	var nextAtv  		= getValue("WKNextState");
	var codSolicitacao  = getValue("WKNumProces");
	//RECUPERA NUMERO DO DOCUMENTO
	var idDocumento = getValue("WKCardId");
	var idFormulario = getValue("WKFormId")
	var empresa = getValue("WKCompany");
	 //RECUPERA USUARIO LOGADO
    var usuario = getValue('WKUser');
	
	
	var autorizado 		 = hAPI.getCardValue("aprovacao");
	var aprovadoNoPrazo  = hAPI.getCardValue("aprPrazo");		
	
    var dtVencimento	 = hAPI.getCardValue("dtPagamento");
    var valorTotal		 = hAPI.getCardValue("vl_rmb");
 	
	
	if ((ativAtual == APROVACAO_RH && autorizado == "aprovado" && aprovadoNoPrazo == "" ) || ativAtual == ALTERACAO_DATA){
			var constraint = new Array();		  						     
			constraint.push(DatasetFactory.createConstraint("documentid", idDocumento, idDocumento, ConstraintType.MUST));			
			constraint.push(DatasetFactory.createConstraint("valor", valorTotal, valorTotal, ConstraintType.MUST));  
			constraint.push(DatasetFactory.createConstraint("dataVencimento", dtVencimento, dtVencimento, ConstraintType.MUST));
				
			
			var resultDataset = DatasetFactory.getDataset("VM_FINA050_SOLICITACAO_REEMBOLSO_AUXILIO_CRECHE", null, constraint, null);
			
				  if (resultDataset.getValue(0,"RETORNO") != "SUCESSO"){
			    	throw resultDataset.getValue(0,"RETORNO");
			      } 
				  else {
					  hAPI.setTaskComments(usuario, codSolicitacao, 0, "Solicitação integrada com o sistema Protheus");
				  }
			
		  
	
	}
	
}
